def main() -> None:
    rows = [line.rstrip("\n") for line in RAW_DATA.strip("\n").splitlines() if line.strip()]
    reader = csv.reader(rows, delimiter="\t")
    output_path = Path("data/machine_events_sample.csv")
    output_path.parent.mkdir(parents=True, exist_ok=True)

    with output_path.open("w", newline="") as csvfile:
        writer = csv.writer(csvfile)
        for row in reader:
            writer.writerow(row)

    print(f"Wrote {len(rows) - 1} rows to {output_path}")


if __name__ == "__main__":
    main()
